import { Box, Grid, Input, InputLabel, Typography } from "@material-ui/core";
import React from "react";

export default function ChangePassword() {
  return (
    <Box className="container ">
      <Grid container justifyContent="center" spacing={1}>
        <Grid item xs={12} className="my-5 text-center">
          <Typography variant="h4" className="font-family-Ad" color="white ">
            Change My Password
          </Typography>
        </Grid>
        <Grid item xs={8}>
          <InputLabel sx={{ color: "#999" }}>Old Password</InputLabel>
          <Input type="text" className="form-control member-input" />
        </Grid>
        <Grid item xs={8}>
          <InputLabel sx={{ color: "#999" }}>New Password</InputLabel>
          <Input type="text" className="form-control member-input" />
        </Grid>
        <Grid item xs={8}>
          <InputLabel sx={{ color: "#999" }}>Re-New Password</InputLabel>
          <Input type="text" className="form-control member-input" />
        </Grid>
      </Grid>
    </Box>
  );
}

const InputChange = () => {
  return (
    <Grid item xs={8}>
      <InputLabel sx={{ color: "#999" }}>Old Password</InputLabel>
      <Input type="text" className="form-control member-input" />
    </Grid>
  );
};

const listInput = [
  {
    label: "Old Password",
  },
  {
    label: "New Password",
  },
  {
    label: "Re-New Password",
  },
];
